// Imports
const { randomUUID } = require("crypto")
const { log, LogLevel } = require("@peacockproject/core/loggingInterop")

// Control if targets should be shown in instinct/minimap
// This can fix a crashing issue when someone is killed [Default: true]
const showTargets = true

// Control if targets should be registered at all
// This can fix many issues (shots not registering, crashing)
// BUT this will stop the SA tracker from working properly (final scoring WILL NOT be affected)
// The previous setting will not matter as they will not be registered [Default: true]
const registerTargets = true

// EXPERIMENTAL: This is not a confirmed fix for crashing or shots not registering
// WARNING: This may just cause more lag when completing multiple objectives at once
// This will split all the targets into separate objectives, it won't affect anything gameplay wise
// If this solves some issues for you, please let me know on discord
// !!!! THIS IS MORE LIKELY TO CAUSE LAG OR JUST NOT FIX ANYTHING AND MAYBE EVEN CAUSE MORE CRASHES !!!!
// If this is active, the previous two are overridden [Default: false]
const splitObjectives = false

// This function generates the mission manifest (aka json) as defined by our settings
function generateMission(settings) {
    const mission = {
        Data: {
            Bricks: settings.bricks || [],
            Entrances: settings.entrances || [],
            Stashpoints: settings.stashpoints || [],
            GameChangers: ["79ace974-8886-4669-927e-84f4ee6256a6"],
            Objectives: [
                {
                    Id: "e5cfe2a9-84a5-4716-a928-6ca4d07a41df",
                    Category: "primary",
                    ObjectiveType: "custom",
                    ForceShowOnLoadingScreen: true,
                    Image: "images/challenges/bangkok/horror_axe_kill.jpg",
                    BriefingName: "Kill Everyone",
                    LongBriefingText: "Eliminate everyone.\n",
                    BriefingText: "Eliminate everyone.\n",
                    HUDTemplate: {
                        display: "Kill Everyone",
                    },
                    OnActive: {
                        IfCompleted: {
                            Visible: true,
                        },
                    },
                    IsHidden: !showTargets,
                    Type: "statemachine",
                    Scope: "hit",
                    Definition: {
                        Context: {
                            Targets: splitObjectives
                                ? []
                                : registerTargets
                                    ? settings.targets
                                    : [],
                            ForceUpdateCounters: 0,
                            TargetsDown: 0,
                            TargetsRemaining: settings.targets.length,
                            TargetsInTotal: settings.targets.length,
                            SodersDied: 0,
                        },
                        ContextListeners: {
                            TargetsRemaining: {
                                type: "objective-counter",
                                header: "UI_PEACOCK_REMAINING",
                                deactivate: 0,
                            },
                            ForceUpdateCounters: {
                                type: "force-update",
                                target: "TargetsRemaining",
                            },
                        },
                        States: {
                            Start: {
                                "-": {
                                    Condition: {
                                        $eq: ["$.ForceUpdateCounters", 0],
                                    },
                                    Actions: {
                                        $inc: "ForceUpdateCounters",
                                    },
                                },
                                Kill: {
                                    Actions: {
                                        $inc: "TargetsDown",
                                        $dec: "TargetsRemaining",
                                    },
                                    Transition: "CheckCount",
                                },
                                Soders_Dead: {
                                    Condition: {
                                        $eq: ["$.SodersDied", 0],
                                    },
                                    Actions: {
                                        $inc: ["TargetsDown", "SodersDied"],
                                        $dec: "TargetsRemaining",
                                    },
                                    Transition: "CheckCount",
                                },
                                CompleteObjective: {
                                    Transition: "Success",
                                },
                            },
                            CheckCount: {
                                "-": [
                                    {
                                        Condition: {
                                            $eq: [
                                                "$.TargetsDown",
                                                "$.TargetsInTotal",
                                            ],
                                        },
                                        Actions: {
                                            $set: ["TargetsRemaining", 0],
                                        },
                                        Transition: "Success",
                                    },
                                    {
                                        Transition: "Start",
                                    },
                                ],
                            },
                        },
                    },
                },
            ],
        },
        Metadata: {
            Id: settings.id,
            IsPublished: true,
            TileImage: settings.image,
            Location: settings.location,
            Title: settings.title,
            AllowNonTargetKills: true,
            ScenePath: settings.scene,
            Type: settings.type || "mission",
            Entitlements: settings.entitlements,
        },
        UserData: {},
    }

    if (settings.loadout) mission["Data"]["MandatoryLoadout"] = settings.loadout
    if (settings.grouptitle)
        mission["Metadata"]["GroupTitle"] = settings.grouptitle
    if (settings.subtype) mission["Metadata"]["Subtype"] = settings.subtype

    if (splitObjectives) {
        settings.targets.forEach((target) => {
            let objective = {
                Id: randomUUID(),
                Category: "condition",
                Type: "statemachine",
                ExcludeFromScoring: true,
                OnActive: {
                    IfInProgress: { Visible: false },
                    IfCompleted: { Visible: false },
                    IfFailed: { Visible: false },
                },
                Definition: {
                    Scope: "hit",
                    Context: {
                        Targets: [target],
                    },
                    States: {
                        Start: {
                            Kill: {
                                Condition: {
                                    $eq: ["$Value.RepositoryId", target],
                                },
                                Transition: "Success",
                            },
                        },
                    },
                },
            }

            if (target === "5651198f-9ef7-4f3c-908b-a570f1cd64e2") {
                objective["Definition"]["States"] = {
                    Start: {
                        Soders_Dead: {
                            Transition: "Success",
                        },
                    },
                }
            }

            mission["Data"]["Objectives"].push(objective)
        })
    } else {
        mission["Data"]["Objectives"][0]["Definition"]["States"]["Start"][
            "Soders_Dead"
        ]["Actions"]["$remove"] = [
                "Targets",
                "5651198f-9ef7-4f3c-908b-a570f1cd64e2",
            ]
    }

    return mission
}

// This generates a base campaign, here to avoid repetition
function generateCampaign(name, extraCampaigns = []) {
    const subgroups = []
    extraCampaigns.forEach((subgroup) =>
        subgroups.push(generateCampaign(subgroup))
    )
    return {
        Name: name,
        Image: "",
        Type: "campaign",
        BackgroundImage: null,
        StoryData: [],
        Subgroups: subgroups || [],
        Properties: {
            BackgroundImage: "images/contracts/kec/campaign.png",
        },
    }
}

