module.exports = function killEveryoneCampaign(controller) {
    // Main campaign definition
    const kecCampaign = {
        Name: "UI_CAMPAIGN_KILLEVERYONE",
        Image: "",
        Type: "campaign",
        BackgroundImage: null,
        StoryData: [],
        Subgroups: [
            generateCampaign("UI_SEASON_1"),
            generateCampaign("UI_SEASON_2"),
            generateCampaign("UI_SEASON_3"),
            generateCampaign("UI_MENU_PAGE_SIDE_MISSIONS_TITLE", [
                "UI_CONTRACT_CAMPAIGN_WHITE_SPIDER_TITLE",
                "UI_MENU_PAGE_BONUS_MISSIONS_TITLE",
                "UI_MENU_PAGE_SPECIAL_ASSIGNMENTS_TITLE",
            ]),
        ],
        Properties: {
            BackgroundImage: "images/contracts/kec/campaign.png",
        },
    }

    // Add missions
    const seasons = [
        season1,
        season2,
        season3,
        patientzero,
        bonus,
        specialassignments,
    ]
    seasons.forEach((season) =>
        season.forEach((settings) =>
            controller.addMission(generateMission(settings))
        )
    )

    controller.hooks.contributeCampaigns.tap(
        "KillEveryoneCampaign",
        (campaigns, gsmFunc, gsvFunc, gameVersion) => {
            if (gameVersion !== "h3") return

            // Add missions to the menu
            season1.forEach((mission) =>
                kecCampaign.Subgroups[0].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )
            season2.forEach((mission) =>
                kecCampaign.Subgroups[1].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )
            season3.forEach((mission) =>
                kecCampaign.Subgroups[2].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )

            patientzero.forEach((mission) =>
                kecCampaign.Subgroups[3].Subgroups[0].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )
            bonus.forEach((mission) =>
                kecCampaign.Subgroups[3].Subgroups[1].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )
            specialassignments.forEach((mission) =>
                kecCampaign.Subgroups[3].Subgroups[2].StoryData.push(
                    gsmFunc(mission.id, gameVersion)
                )
            )

            // Find the Side Missions page and add our campaign
            campaigns.forEach((menu) => {
                if (menu.Name === "UI_MENU_PAGE_SIDE_MISSIONS_TITLE") {
                    menu.Subgroups.push(kecCampaign)
                }
            })
        }
    )

    log(
        LogLevel.INFO,
        "[KEC] Ready to start killing everyone! (Plugin Started)"
    )
}
